            // Ajouter des tooltips  tous les marqueurs
            (function() {
                var map = map_b78cea322060eeb7d9d1b1cbd866e3dd;
                var markers = [];
                
                // Collecter tous les marqueurs de la carte
                map.eachLayer(function(layer) {
                    if (layer instanceof L.CircleMarker) {
                        markers.push(layer);
                    }
                });
                
                // Ajouter des tooltips bass sur la couleur et les coordonnes
                markers.forEach(function(marker) {
                    var lat = marker.getLatLng().lat;
                    var lng = marker.getLatLng().lng;
                    var color = marker.options.color || marker.options.fillColor || 'blue';
                    var radius = marker.options.radius || 5;
                    
                    // Dterminer le niveau de mobilit verte selon la couleur
                    var mobilityLevel = '';
                    if (color === 'green' || color === '#00ff00') {
                        mobilityLevel = 'Mobilit Verte: leve';
                    } else if (color === 'orange' || color === '#ffa500' || color === 'yellow' || color === '#ffff00') {
                        mobilityLevel = 'Mobilit Verte: Moyenne';
                    } else if (color === 'red' || color === '#ff0000') {
                        mobilityLevel = 'Mobilit Verte: Faible';
                    } else {
                        mobilityLevel = 'Commune';
                    }
                    
                    // Crer le texte du tooltip
                    var tooltipText = '<b>' + mobilityLevel + '</b><br>Lat: ' + lat.toFixed(4) + '<br>Lng: ' + lng.toFixed(4);
                    
                    // Ajouter le tooltip
                    marker.bindTooltip(tooltipText, {
                        permanent: false,
                        direction: 'top',
                        offset: [0, -10]
                    });
                    
                    // Ajouter aussi un popup au clic
                    var popupText = '<div style="min-width: 150px;"><b>' + mobilityLevel + '</b><br>' +
                        'Coordonnes:<br>Latitude: ' + lat.toFixed(6) + '<br>Longitude: ' + lng.toFixed(6) + 
                        '<br>Taille: ' + radius.toFixed(1) + '</div>';
                    marker.bindPopup(popupText);
                });
                
                console.log('Tooltips ajouts  ' + markers.length + ' marqueurs');
            })();
